import React from 'react'
import { HomeCard } from './homeCard'
import './home.css'
export const Home = (props) => {
  return (
    <>
        <div className="homeContainer">
            {
                props.items.map((item) =>(
                    <HomeCard key={item.id} item={item}/>
                ))
            }
        </div>
    </>
  )
}
